Danish language! No subtitles! This is however a masterpiece! 


A four chapter story about urbane Charlot and naive Charlotte whos destinies merge to an adventure accross Denmark where they meet various people.

Written and directed by Ole Bornedal.

Critically acclaimed and winner of the Prix Italia 1996.
